import React, { useEffect } from "react";

const TodoDetail = () => {
  const [list, setList] = useState([]);
  useEffect(() => {
    getData();
  }, []);

  const getData = async () => {
    try {
      axios
        .get("https://jsonplaceholder.typicode.com/posts")
        .then((res) => {
          console.log("res: ", res);
          setList(res.data);
        })
        .catch((err) => {
          console.log("err: ", err);
        });
    } catch (error) {
      console.log(`error: ${error}`);
    }
  };
  return <div></div>;
};

export default TodoDetail;
